import { ArrowLeftRounded, ArrowRightRounded } from "@material-ui/icons"
import styled from "styled-components"

const Container = styled.div`
    width: 100%;
    height: 100vh;
    display: flex;
`
const Arrow = styled.div`
    width: 50px;
    height: 50px;
    background-color: #;
    border-radius: 50%;
`

const Slider = () => {
  return (
    <Container>
        <Arrow>
            <ArrowLeftRounded />
        </Arrow>
        <Arrow>
            <ArrowRightRounded />
        </Arrow>
    </Container>
  )
}

export default Slider
